function generateSparklineData(trend: number): number[] {
  // Generate 24 data points for the sparkline
  const data: number[] = []
  let value = 100

  // Use the trend to influence the direction
  const trendFactor = trend / 100

  for (let i = 0; i < 24; i++) {
    // Random change with trend bias
    const change = (Math.random() * 2 - 1 + trendFactor) * 2
    value = Math.max(value + change, 1) // Ensure value stays positive
    data.push(value)
  }

  return data
}
